body{
  margin:0;
  padding:0;
  box-sizing:border-box;
  list-style:none;
  background-color:#FFFFF;
}

`;

export default function ToDo() {
  return (
    <>
      <GlobalStyle />
      <Header />
      <Main />
    </>
  );
}
